import React, { Component } from "react";
import { connect } from "react-redux";
import { Modal, Button, Row, TextInput } from "react-materialize";
import Loading from "../loading/Loading";
class BusinessModalDetail extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    componentDidMount() {
        this.setState({
            business: this.props.business
        });
    }

    render() {
        const { business } = this.props;
        return (
            <Modal
                actions={[
                    <Button flat modal='close' node='button' waves='green'>
                        Close
                    </Button>
                ]}
                open={true}
                style={{ boder: "none" }}
                bottomSheet={false}
                fixedFooter={false}
                header='Business Detail'
                id='modal1'
                options={{
                    dismissible: true,
                    endingTop: "10%",
                    inDuration: 250,
                    onCloseEnd: null,
                    onCloseStart: null,
                    onOpenEnd: null,
                    onOpenStart: null,
                    opacity: 0.5,
                    outDuration: 250,
                    preventScrolling: true,
                    startingTop: "4%"
                }}
            >
                <form>
                    <Row>
                        <TextInput
                            s={12}
                            l={6}
                            m={6}
                            xl={6}
                            label='Name:'
                            value={business.name}
                        />
                        <TextInput
                            s={12}
                            l={6}
                            m={6}
                            xl={6}
                            label='Address'
                            value={business.address}
                        />
                        <TextInput
                            s={12}
                            l={6}
                            m={6}
                            xl={6}
                            label='Phone:'
                            value={business.phone}
                        />

                        <TextInput
                            s={12}
                            l={6}
                            m={6}
                            xl={6}
                            label='Province'
                            value={business.province}
                        />


                    </Row>
                </form>
            </Modal>
        );
    }
}

const mapStateToProps = state => {
    return { provinces: state.provinces };
};

const mapDispatchToProps = {};

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(BusinessModalDetail);
